import './index.css';



  for (var i = 0; i < 3; i++) {

    class Kissakuva extends React.Component {
      render() {
        return <img src="https://cataas.com/cat"></img>;
      }
    }
    ReactDOM.render(
      <Kissakuva />
    , document.getElementById("content"));
    }


